import React from 'react';
import '../src/styles/main.scss';

function MyApp({ Component, pageProps }) {

  const Layout = Component.Layout || (children => <> {children} </>)

  return (
    <Layout>
      <Component {...pageProps} />
    </Layout>
  )
}

export default MyApp;
